    public class HPRMasterDataSeed
    {
        public static async Task SeedAsync(ApplicationDbContext dbContext, ILogger<HPRMasterDataSeed> logger)
        {
            if (dbContext.Countries.FirstOrDefault() == null)
            {
                dbContext.AddRange(AddCountryData());
            }
            if (dbContext.LanguageSpokens.FirstOrDefault() == null)
            {
                dbContext.AddRange(AddLanguageData());
            }
            if (dbContext.MedicineSystems.FirstOrDefault() == null)
            {
                dbContext.AddRange(AddMedicineSystem());
            }
            await dbContext.SaveChangesAsync();

            if (dbContext.DoctorCouncils.FirstOrDefault() == null)
            {
                dbContext.AddRange(AddCouncils());
            }
            if (dbContext.DoctorDegree.FirstOrDefault() == null)
            {
                dbContext.AddRange(AddDoctorDegree());
            }
            if (dbContext.DoctorSpecialities.FirstOrDefault() == null)
            {
                dbContext.AddRange(AddDoctorSpecialities());
            }

            if (dbContext.DoctorUniversities.FirstOrDefault() == null)
            {
                dbContext.AddRange(AddDoctorUniversities());
            }
            await dbContext.SaveChangesAsync();

            if (dbContext.DoctorColleges.FirstOrDefault() == null)
            {
                dbContext.AddRange(AddDoctorColleges());
            }
            await dbContext.SaveChangesAsync();
            logger.LogInformation("Seed database associated with context {DbContextName}", typeof(ApplicationDbContext).Name);
        }

